############################ OLHA A PAUTA DO CONGRESSO PRA SEGURANÇA###############: 1) Federalizar as forças de segurança pública, o que apenas centraliza o poder e é exatamente o oposto do caminho técnico, de aproximar as organizações policiais ao máximo do núcleo social em que atuam;

2) Criar o "Estatuto do Desarmamento 2.0", desfigurando as propostas que hoje estão em tramitação, para, na prática, se propor:

- Aumento de pena para os crimes de contato com armas;
- Manutenção da proibição ao porte de arma;
- Eliminação, apenas, da discricionariedade para a posse.

3) Reformas legislativas para ampliação de penas alternativas, afastando ainda mais os criminosos da punição por seus delitos. FAÇAM ALGO E PAREM DE DISCURSO!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
